namespace Leetcode.Tests;

public class FindAllAnagramsInAString438Test
{
    [Fact]
    public void FindAnagrams()
    {
        var sln = new FindAllAnagramsInAString438();
        var result1 = sln.FindAnagrams("cbaebabacd", "abc");
        Assert.Equal("[0,6]", LeetcodeHelper.Array2String(result1.ToArray()));
        var result2 = sln.FindAnagrams("abab", "ab");
        Assert.Equal("[0,1,2]", LeetcodeHelper.Array2String(result2.ToArray()));
        var result3 = sln.FindAnagrams("", "");
        // Assert.Equal("[0,1,2,3]", LeetcodeHelper.Array2String(result3.ToArray()));
        Assert.Equal(10063, result3.Count);
    }
}